import { TextInput, View, Text } from "react-native";
import { Component } from "react";
class Temporary extends Component {
  // constructor(props: any) {
  //   super(props);
  // }
  render() {
    return (
      <View>
        <Text>asdasd</Text>
      </View>
    );
  }
}

export default Temporary;
